import './App.css';
import Header from './Header';

import { useState } from "react";
import default_lat from './config/config.js';
import default_lon from './config/config.js';
import Results from './Resultados';
//import CONFIG from './config/config.js';

function App() {

  const [lat,setLat] = useState(default_lat.default_lat);
  const [lon,setLon] = useState(default_lon.default_lon);

  return (
    <div className="App">
      <Header />
      <h2 id='titulo'>El tiempo</h2>
      <p>
        <label>Latitud:</label>
        <input type="number" id='latitud' value={lat} placeholder="Latitud" onChange={e=>setLat(e.target.value)}/>
        <label>Longitud:</label>
        <input type="number" id='longitud' value={lon} placeholder="Longitud" onChange={e=>setLon(e.target.value)}/>
      </p>
      <button id='buscar'>Buscar</button>
      <Resultados />
    </div>
  );
}

export default App;
